import React from "react";
import "./BlogCard.css";


function BlogCard({ cardData }) {
  return (
    <div style={{ display: "flex", flexWrap: "wrap", gap:'8px', padding:'4px' }}>
      {cardData.map((card) => {
        return (
          <>
            <div key={Math.random() * 100} className="blog__card__container">
              <div className="card">
                <div className="card__header">
                  <img
                    src="https://source.unsplash.com/600x400/?computer"
                    alt="card__image"
                    className="card__image"
                    width="600"
                  />
                </div>
                <div className="card__body">
                  <span className="tag tag-blue">{card.title}</span>
                  <h4>{card.content}</h4>
                  <p>{card.description}</p>
                </div>
                <div className="card__footer">
                  <div className="user">
                    <img
                      src={card.createdBy.profilePic}
                      alt="user__image"
                      className="user__image"
                      style={{width:'30px'}}
                    />
                    <div className="user__info">
                      {console.log(card.createdBy, "card-creator")}
                      <h5>{card.createdBy.fullname}</h5>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </>
        );
      })}
    </div>
  );
}

export default BlogCard;
